import React, { useState } from "react";
import Home from "../pages/Home.js";
import Login from "../pages/Login.js";
import SignUp from "../pages/SignUp.js";
import Help from "../pages/Help.js";
import Profile from "../pages/Profile.js";
import Setting from "../pages/Setting";

const [theme,setTheme] = useState(props.theme);

const Routes = {
  "/": () => <Home theme={theme} handleThemeChange={handleNavbarThemeChange} />,
  "/login": () => <Login theme={theme} handleThemeChange={handleNavbarThemeChange} />,
  "/sign_up": () => <SignUp theme={theme} handleThemeChange={handleNavbarThemeChange} />,
  "/help": () => <Help theme={theme} handleThemeChange={handleNavbarThemeChange} />,
  "/profile": () => <Profile theme={theme} handleThemeChange={handleNavbarThemeChange} />,
  "/setting": () => <Setting theme={theme} handleThemeChange={handleNavbarThemeChange} />
};
export default Routes;
